import React from 'react';

const HomePage = () => {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.title}>Hasaki Beauty Store</h1>
        <p style={styles.subtitle}>Welcome to Hasaki Beauty Store! Explore our collection of premium beauty products.</p>
      </header>
      <section style={styles.featuredProducts}>
        {/* Thêm các sản phẩm nổi bật ở đây */}
      </section>
      <section style={styles.aboutUs}>
        <h2>About Us</h2>
        <p>We strive to provide the best beauty products for our customers. Our products are carefully curated to enhance your natural beauty.</p>
      </section>
      {/* Thêm các phần tử UI khác tại đây */}
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '800px',
    margin: '0 auto',
    padding: '20px',
  },
  header: {
    textAlign: 'center',
    marginBottom: '40px',
  },
  title: {
    fontSize: '2.5rem',
    color: '#333',
  },
  subtitle: {
    fontSize: '1.2rem',
    color: '#666',
  },
  featuredProducts: {
    marginBottom: '40px',
  },
  aboutUs: {
    marginBottom: '40px',
  },
  // Thêm các kiểu CSS khác tại đây nếu cần
};

export default HomePage;
